// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import HomePage from './components/HomePage';
import DistrictCourtPage from './components/DistrictCourt';
import HighCourtPage from './components/HighCourtPage';
import SupremeCourtPage from './components/SupremeCourt';
import CourtPage from './components/CourtPage'; // Import CourtPage
import StateSelection from './components/StateSelection'; 

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/district" element={<StateSelection courtType="district" />} />
        <Route path="/high" element={<StateSelection courtType="high" />} />
        <Route path="/court/:courtType/:state" element={<CourtPage />} /> {/* Redirect to CourtPage */}
        <Route path="/view-judgment/:courtType/:state" element={<div>View Judgment Page</div>} /> {/* Placeholder for View Judgment */}
        <Route path="/upload-judgment/:courtType/:state" element={<div>Upload Judgment Page</div>} /> {/* Placeholder for Upload Judgment */}
        <Route path="/supreme" element={<SupremeCourtPage />} />
      </Routes>
    </Router>
  );
}

export default App;
